  false,\n\t\"url\": null,\n\t\"notes\": \"This Public Use Review/Plan for St. Vincent
  National Wildlife Refuge was updated August 19th, 1988.  It outlines goals for interpretation,
  outdoor classrooms, educational assistance, program information, wildlife-oriented
